import React from 'react';
import './training.css';
import { Link } from 'react-router-dom';

import About_img from '../../assets/About.jpg';



const Training = () => {
  return (
    <div className="container_training" id="training">
      <div className="image-container">
        <img src={About_img} alt="About_img" />
        <Link to="/other-page" className="button-overlay">Перейти на другую страницу</Link>
      </div>
      <div className="text_training">А здесь будет о тренировках и большая кнопка, которая ведет на другую страницу</div>
    </div>
  );
}
export default Training
